import * as React from 'react';
import { View, Text} from 'react-native';
import { Button } from 'react-native-web';
import {Toolbar,ToolbarBackAction,ToolbarContent} from 'react-native-paper';

function BreakfastScreen({navigation}) {
  return (
    <><Toolbar>
      <ToolbarBackAction
        onPress={this._goBack} />
      <ToolbarContent
        title="Title"
        subtitle="Subtitle" />
    </Toolbar><View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
        <Text>Category</Text>
        <div className="App">
          <input type="text" placeholder="Search Pancake" />
        </div>
        <Button
          title="Go to Bluebarry Pancake"
          onPress={() => navigation.navigate('Bluebarry Pancake')} />
      </View></>
  );
}
export default BreakfastScreen;
